import React, { useEffect } from "react";

const Astrology = () => {
  useEffect(() => {
    fetch("http://sandipbgt.com/theastrologer/api/sunsigns").then((response) =>
      response.json()
    );
    console.log(response);
  }, []);
  return (
    <>
      <div className="astrology">
        {["a", "b", "c"].map((sign) => (
          <button key={sign}>{sign}</button>
        ))}
      </div>
    </>
  );
};

export default Astrology;
